import React from 'react'
import "./Message.css"
import { Alert } from "react-router-dom"

const Message = ({ variant, children }) => {
    return (
        <Alert variant={variant}>
            {children}
        </Alert>
    )
}

Message.defaultProps = {
    variant: "info"
}

export default Message
